    [],nt"revision_timestamp": "2016-07-27T22:50:11.099913",nt"name": "rice-lake-national-wildlife-refuge-narrative-report-january-april-1962",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Rice Lake NWR
    outlines Refuge accomplishments from January through April of 1962. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, reptiles,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, collections and receipts, prescribed
    burning, and wildfires. Resource management is outlined; topics include haying,
    fur harvesting, and timber removal. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, and violations. Items
    of interest and N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
